import React from "react";
import { Link } from "react-router-dom";
import SearchedResultVideos from "./SearchedResultVideos";


const SearchResults = ({suggestions}) => {
    const [searchResults, setSearchResults] = useState(false);
    const handleShowSearchResults = ()=>{
    console.log(searchResults);
    setSearchResults(true);
  }
  return (
    <div>
        <div className="flex justify-start">
              <div className=" mt-4 shadow-2xl border border-gray-200 rounded-xl absolute bg-white w-[38rem]">
                <ul className="my-4">
                  {suggestions.map((data, index) => (
                    <Link key={index}
                      onClick={() => {
                        handleShowSearchResults()
                      }}
                      to="/search"
                    >
                      <li
                        className="flex items-center hover:bg-gray-100 px-4 py-2"
                      >
                        <img
                          className="w-5 h-5 mr-3"
                          src="https://cdn-icons-png.flaticon.com/512/54/54481.png"
                          alt=""
                        />
                        {"  " + data}
                      </li>
                    </Link>
                  ))}
                </ul>
              </div>
              <img
                className="w-3 h-3"
                src="https://cdn-icons-png.flaticon.com/512/54/54481.png"
                alt=""
              />
            </div>

    </div>
  );
};

export default SearchResults;
